INSERT INTO `v10` (`time`, `y`, `info`) VALUES
('-11500', '280', 'cultivation of wild barley and oats around village settlements (Fertile Crescent) → dawn of farming on the Anatolian peninsula; storable grains sustaining population growth'),
('-126000', '280', 'Homo with mix of archaic-human and Neanderthal traits (Nesher Ramla, Israel): stone-tool industry, cooking meat; cultural exchange with humans?'),
('-1500000', '280', 'earliest control of fire, by Homo erectus (Koobi Fora, Kenya): uniquely human capability → extending the day with firelight; improving nutrient uptake with cooked food by 780,000 years ago; widespread use of fire by 400,000 years ago'),
('-176000', '280', 'earliest built constructions: underground edifices made from broken stalagmites by Neanderthals (Bruniquel Cave, France) → material culture'),
('-23000', '280', 'first domestication: dogs from grey wolves Canis lupus (Siberia or Japan), for companionship, hunting technology, and pulling sledges → 700 million dogs by CE 21ˢᵗ century'),
('-3050', '280', 'start of the Iron Age (Aegean; Britain by 800 BCE), iron replacing bronze for tools and weapons'),
('-4000', '280', 'earliest use of coal as fuel (Inner Mongolia and Shanxi, China), for smelting copper, cooking, heating → peak global coal production of 8.2 billion tonnes/year in CE 2013?'),
('-40000', '280', 'full development of language, facilitating efficient social bonding through gossip → now over 7,000 living languages, over 2,000 vanishing'),
('-50000', '280', 'earliest use of cord: three-plied bark fibres (Abri du Maras, France) → clothing, mats, baskets, nets, rope, snares, fishing lines, watercraft'),
('-73000', '280', 'earliest drawing by humans: criss-crossed lines on a grindstone drawn with red-ochre crayon (Blombos Cave, South Africa)'),
('-7900', '280', 'start of the Copper Age (Fertile Crescent), spread of copper smelting for weapons and tools'),
('1769', '280', 'invention of the first cost-effective steam engine (James Watt, Britain, 1769) → powered machinery, Industrial Revolution'),
('1919', '280', 'first commercial radio broadcasts (PCGG, Netherlands, 1919); global uptake during 1920s → dissemination of time signals, news, propaganda, education, entertainment; storytelling for the complicit listener'),
('1954', '280', 'first nuclear power plant (Obninsk, USSR, 1954) → advent of clean energy: 10% of global electricity generation in 2019; radioactive waste; nuclear catastrophes, including Chernobyl, Ukraine, 26/4/1986'),
('2013', '280', 'atmospheric concentrations of CO₂ exceed 400 ppm for the first time in at least 3 million years, an accelerating rise (NOAA, Hawaii, 5/2013) → race for technologies to capture and use CO₂'),
('2020', '280', 'global land and ocean surface temperature for 2020 exceeds 1°C above the 1951-1980 mean for the first time, 1.2°C above the pre-industrial 1850-1900 baseline, with 2011-2020 the 4ᵗʰ decade in succession to claim warmest average temperature');
